import logo from './logo.svg';
import {Navbar} from 'reactstrap';
import './App.css';
function App() {
  return (
    <div className="App">
      <Navbar dark colot="primary">
        <div className="container">
        <NavbarBrand href="/">Hello!!</NavbarBrand>
        </div>
    </Navbar>
    </div>
  );
}

export default App;
